Information
------------------------------
Artist and illustrator Julie Verhoeven re-interprets the iconic 1970s book through a piece of artwork and in doing so expresses her understanding of the joy of sex in the 21st century. On her journey, Verhoeven meets the original The Joy of Sex illustrator Chris Foss, who reveals the behind-the-scenes detail of putting together the original collection of images.

